import React, { Component } from 'react';
import '../../styles/about.css'

class AboutMe extends Component {
	render() {
		return (
			<div>
				<h1 style={{textAlign:"center"}}><b>Hello There!</b></h1>
				<img src={"https://i.redd.it/v9ch8s7hhl501.jpg"} alt={""} />
				<p>Hi, I am Nigel, and thank you for visiting my website!</p>
				<br />
				<p>I graduated from Washington State University with
				   with a B.S in Computer Science. I am currently looking to start
				   my career in the tech industry.
				</p>
				<img src={"https://cdn.worldvectorlogo.com/logos/washington-state-cougars-2.svg"} alt={""} />
			</div>
		);
	}
}

const imgStyle = {
	display:"block",
	marginLeft:"auto",
	marginRight:"auto",
	width:"200px",
	height:"100px"
}

export default AboutMe;
